import React from 'react';

import Theme from '../containers/Theme/Theme';
import Beach from '../assets/ocean.mp4';

function OceanWave() {
  return <Theme url="/assets/ocean.mp3" theme="ocean" bg={Beach} />;
}

export default OceanWave;
